import React from "react";
import { Card, Icon } from "semantic-ui-react";
import faker from "faker";

const extra = (
  <a>
    <Icon name="user" />
  </a>
);

const CardExampleCardProps = () => (
  <Card
    image={faker.image.avatar()}
    header="Elliot Baker"
    meta="Friend"
    description="Ellis cat."
    extra={extra}
  />
);

export default CardExampleCardProps;
